def class_feature_importance(X, Y, feature_importances):
    N, M = X.shape
    X = scaler.transform(X)
    out = {}
    for c in set(Y):
        out[c] = dict(
            zip(range(N), np.mean(X[Y==c, :], axis=0)*feature_importances))

    return out

